import React from 'react'
import image from '../images/cyanbb.png'
import Contact from '../components/Contact'
import contactsData from '../ContactData'
import { Link } from 'react-router-dom'



function ContactCard() {
    const contactDetails = contactsData.map(contacts => {
      return (
        <Contact
          id={contacts.id}
          {...contacts}
        />
      )
    })

    return (
      <div className='card-div'>
        {contactDetails}
      </div>
    );
  }

export default function Houses(){
    return (
        <div className='indexpage'>
            <img className='background-img' src={image} alt='background' />
            <div className='home-box'>
                <div className='houses-components'>
                    {/* <Link to ='#' className='btn btn-white btn-animation-1'>Listings</Link>
                    <Link to ='#' className='btn btn-white btn-animation-1'>Postings</Link> */}
                    <div class="tab">
                    <button class="tablinks " onclick="openCity(event, 'Listings')">Listings</button>
                    <button class="tablinks" onclick="openCity(event, 'Postings')">Postings</button>
                </div>
                <div id="Listings" className="tabcontent">
                    <h3>Listings</h3>
                    <p>Listings is the capital city of England.</p>
                </div>

                <div id="Postings" className="tabcontent">
                    <h3>Postings</h3>
                    <p>Postings is the capital of France.</p>
                </div>
                </div>


                {/* <ContactCard /> */}
            </div>
        </div>
    )
}
